import Recat from 'react';
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note';
const App = () => {

    const addNote = () => {
        alert("I am clicked");
    };

    return(
        <>
           <Header/>
           <Footer/>
           <CreateNote passNote ={addNote} />
           <Note/>
        </>
    );
};

export default App;
